  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0089638 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise RR1008 in the
  Philippine Sea and South China Sea (Nan Hai) from 2010-06-19 to 2010-07-01. These
  data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
  COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
  These data were collected by Robert Pinkel of SCRIPPS INSTITUTION OF OCEANOGRAPHY
  and SCRIPPS INSTITUTION OF OCEANOGRAPHY as part of Internal Waves in Straits Experiment
  (IWISE). The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC
  as part of the NSF sponsored Rolling Deck to Repository (R2R) program. The ADCP
  data represent the raw and automated processed data set. Post processed quality
  assessed data are not available in this accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
